;;; # 1. Welcome to a short tutorial!
;;; 
;;; @@GrapeVine@@ is an an tool for graph transformations. @@GrapeVine@@ can be used "under the hood" as a library in software projects, but it also comes with a computational notebook UI, which leverages [Gorilla](http://gorilla-repl.org). 
;;; 
;;; A computational notebook consists of mulltiple _worksheets_ (you are looking at one now). Each worksheet consists of _static_ and _executable_ _segments_. 
;;; 
;;; ## 1.1 Static segments
;;; Static segments can contain text using markdown, html, @@\LaTeX@@, images and fancy things like Mermaid diagrams that can be edited online (see below, you may want to right-click links and open in a new window).
