;; **
;;; ## 1.4 Using @@GrapeVine@@ - Resources and namespaces
;;; 
;;; Similar to the above example, *the @@GrapeVine@@ library must be imported* before it can be used. Under the hood, @@GrapeVine@@ connects to the graph database NEO4J so the import. The simplest way to do the import is by using a  `(use 'grape.core')` form, but it's best practice to define a separate namespace for each worksheet. Below creates a worksheet of name `worksheet1`.
;;; 
;;; (**Remember: The statement below must be executed before any @@GrapeVine@@-related commands.** 
;;; (Shift-enter) Establishing the session may take a few seconds. Wait until the green light is gone.)
;;; 
;;; Extend the statement below to import from other worksheets, if your project uses multiple worksheets.
;; **

;; @@
(ns worksheet1
  (:require [grape.core :refer :all]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; **
;;; 
;; **

;; **
;;; # 2. Graphs and graph persistence
;;; 
;;; @@GrapeVine@@ uses a database to store graphs. Graphs, once defined are persisted. Arbitrarily many graphs can be created. Morevover, graphs are maintained in a [fully persistent data structures](https://en.wikipedia.org/wiki/Persistent_data_structure), i.e., _all_ versions of a graph can be accessed and modified.
;;; 
;;; A new (empty) graph is created using the `(newgrape)` function:
;; **

;; @@
(newgrape)
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-list'>(</span>","close":"<span class='clj-list'>)</span>","separator":" ","items":[{"type":"html","content":"<span class='clj-string'>&quot;906936d3-663b-439b-a18c-3f2ef2a2db3a&quot;</span>","value":"\"906936d3-663b-439b-a18c-3f2ef2a2db3a\""}],"value":"(\"906936d3-663b-439b-a18c-3f2ef2a2db3a\")"}
;; <=

;; **
;;; As shown above, graphs are internally identified with a unique ID. That may not be convenient for the worksheet, but we can always declare vars to refer to graphs.
;; **

;; @@
(def g0 (newgrape))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;worksheet1/g0</span>","value":"#'worksheet1/g0"}
;; <=

;; **
;;; The built-in form `view` can be used to generate an image of the content of a graph. (These images are saved when the worksheet is saved.)
;; **

;; @@
(view g0)
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[{"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"427\" height=\"132\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x672ff41d \"BufferedImage@672ff41d: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@5cb468ce transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 427 height = 132 #numDataElements 4 dataOff[0] = 3\"]"}],"value":"(#gorilla_repl.image.ImageView{:image #object[java.awt.image.BufferedImage 0x672ff41d \"BufferedImage@672ff41d: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@5cb468ce transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 427 height = 132 #numDataElements 4 dataOff[0] = 3\"], :alt \"\", :type \"png\", :width 427, :height 132})"}
;; <=

;; **
;;; Unsurprisingly, the graph is empty.
;;; 
;;; ## 2.1 Graph Enumerations (__Grapes__)
;;; 
;;; If you are very perceptive (and have some knowlege of Clojure data types), you may have noted that the above call to `newgrape` returned a one-element _sequence_ rather than a single hash string (as indicated by the brackets `()`). Such a sequence is called a **Graph Enumeration** or **Grape** for short. In @@Grape Vine@@, all operations that produce graphs actually return _Grapes_, even those ones that are guaranteed to generate a single graph only, such as the `newgrape` function.  Using a single data type for operations that can produce graphs greatly simplifies composability of operations (as we will see later). This technique of using a single data type is well known also from other domains, such as the data type of a "relation" in relational databases. (Even queries that are guaranteed to produce a single, unique result will still generate a relation with a single element.)
;;; 
;;; For practical purposes, we will continue to refer to Grapes with a single element as "Graphs".
;; **

;; **
;;; # 3. Graph production rules
;;; 
;;; Graph production rules ("rules" for short) are defined in _hybrid_ language (textual input with graphical view). There are three example rules below. 
;;; 
;;; 1. The first rule (**`hello`**) creates a new node of type _Hello_
;;; 1. The second rule (**`world`**) looks for an existing node of type `Hello` and connects it with a new node of type `World`.
;;; 2. The third rule (**`vine`**) looks for two nodes of type `Hello` and `World`, respectively, which are connected with a `to` edge and replaces the `World` node with a node of type `Grape`. 
;;; 
;;; As we can see in the visualization, green colour marks new graph elements, red coulor marks deleted ones, and balck colour marks "preserved" elements.
;;; 
;;; > _Note: If you want to execute any of these rules, you need to evaluate the code segment below. Otherwise, the rules will not be known. 
;;; Also, note that enclosing these rules in a `(list ...)` form is merely for purposes of rendering multiple rules horizontally in the visualization._
;; **

;; @@
(list
 
(rule 'hello 
   :create (pattern 
             (node :label "Hello")))

(rule 'world 
   :read 	(pattern 
             (node 'h :label "Hello"))
   :create	(pattern 
             (node 'w :label "World")
             (edge :src 'h :tar 'w :label "to")))

(rule 'vine 
   :read 	(pattern 
             (node 'h :label "Hello")
             (node 'w :label "World")
             (edge 'e :src 'h :tar 'w :label "to"))
   :delete ['w 'e]
   :create	(pattern 
             (node 'g :label "Grape")
             (edge :src 'h :tar 'g :label "to")))
 )
;; @@
