;; **
;;; # 4. Rule application
;;; Applying a production rule to a graph is simply calling it on graph. Note that this will produce a new graph (if the rule application succeeds). (Graphs are immutable in @@GrapeVine@@, so `g0` will always be an empty graph.)
;; **

;; @@
(hello g0)
;; @@
