;;; {"type":"list-like","open":"<span class='clj-list'>(</span>","close":"<span class='clj-list'>)</span>","separator":" ","items":[{"type":"html","content":"<span class='clj-string'>&quot;ba2ffd8c-c4c2-4bbe-89fe-caecbeb642f7&quot;</span>","value":"\"ba2ffd8c-c4c2-4bbe-89fe-caecbeb642f7\""}],"value":"(\"ba2ffd8c-c4c2-4bbe-89fe-caecbeb642f7\")"}
