;; **
;;; ## 4.3 Applying rules to Grapes
;;; 
;;; So far, we only applied rules to single graphs, i.e., Grapes with a single element. However, rules can also be applied to Grapes that enumerate multiple graphs. Consider the Grape produced by the following statement. (We create a graph with two `Hello` nodes and then carry out a starred rule application of `world`.) The Grape should have two graphs: 
;; **

;; @@
(-> (newgrape) hello hello world*)
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[{"type":"html","content":"<span class='clj-string'>&quot;70523069-8b6e-4a54-9af7-ae8c99f9282f&quot;</span>","value":"\"70523069-8b6e-4a54-9af7-ae8c99f9282f\""},{"type":"html","content":"<span class='clj-string'>&quot;f2cb231c-c1f7-4718-8d48-7b1909913627&quot;</span>","value":"\"f2cb231c-c1f7-4718-8d48-7b1909913627\""}],"value":"(\"70523069-8b6e-4a54-9af7-ae8c99f9282f\" \"f2cb231c-c1f7-4718-8d48-7b1909913627\")"}
