;; **
;;; # 6. Graph Queries (and Tests)
;;; 
;;; Graph queries also attempt to match a pattern to a graph, but in contrast to rules, queries don't make any changes. Consider the following query, which matches a `Hello` node that is connected to a `Grape` node via a `to` edge.
;;; 
;;; _Note: By convention, names of queries should end with a question mark._
;;; 
;; **

;; @@
(query 'hello-to->grape? []
       (pattern (node 'h :label "Hello")
                (node 'p :label "Grape")
                (edge :src 'h :tar 'p :label "to")))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"231\" height=\"251\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x3ca7a17d \"BufferedImage@3ca7a17d: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@5cb468ce transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 231 height = 251 #numDataElements 4 dataOff[0] = 3\"]"}
;; <=

;; **
;;; Graph queries have two **main purposes**:
;;; 
;;; 1. **Test existence**: They can be used to test the existence of a pattern in the graph
;;; 1. **Query data**: They can be used to query data from graphs (like a database query)
;;; 
;;; ## 6.1 Using Queries as tests
;;; 
;;; Let's explore the first use first. After declaring a graph query (like the one above), existence of a pattern can be tested by calling the name of the query, followed by a question mark (**?**), i.e., `Hello-to->Grape?` in the above case.
;;; 
;;; Let's try:
;; **

;; @@
(hello-to->grape? (newgrape))
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[],"value":"()"}
;; <=

;; **
;;; As expected, the above pattern cannot be found in an empty graph. Let's generate a graph where that pattern can be found:
;; **

