;; **
;;; ## 6.2 Using Queries to extract data
;;; 
;;; The other use for Queries is to extract data from a graph. In order to do so, the name of the query must be appended with an angular bracket (**`>`**). 
;;; 
;;; For each graph, the extracted data is returned in form of a _relation_, i.e., a set of tuples. However, considering that queries are applied to Grapes (enumerations of graphs), the returned data are enumerations (sequences) of relations.
;;; Consider the following example:
;; **

;; @@
(def result (-> (newgrape) hello rel self-related?>))
result
