;; **

;; **
;;; # 7. Transactions 
;;; 
;;; The classical notion of transactions revolves around the ACID (atomic, consistent, isolated, durability) properties. 
;;; 
;;; ## 7.1 Durability
;;; 
;;; Since @@GrapeVine@@ uses a database, all graph productions are automatically made durable. However, not all graphs may be of interest. Moreover, identifying graphs with automatically generated IDs is inconvenient. 
;;; 
;;; Graphs can therefore be tagged with semantic names using the `commit` form. In the following example, we tag the resulting graph with the name "_mygraph_"
;;; 
;;; > **Note: `commit` takes a Grape but will commit only the first graph in the enumeration, if there are multiple.**
;;; 
;; **

;; @@
(-> (newgrape) hello world vine)
(commit _ "mygraph")
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-string'>&quot;50774a87-39f8-4e65-8690-a07763d0eaff&quot;</span>","value":"\"50774a87-39f8-4e65-8690-a07763d0eaff\""}
;; <=

;; **
;;; Once tagged, we can simply call the `graph` form to recall the graph by its semantic name, for example:
;; **

;; @@
(-> (grape "mygraph") view)
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-lazy-seq'>(</span>","close":"<span class='clj-lazy-seq'>)</span>","separator":" ","items":[{"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"191\" height=\"251\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x3f92632b \"BufferedImage@3f92632b: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@5cb468ce transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 191 height = 251 #numDataElements 4 dataOff[0] = 3\"]"}],"value":"(#gorilla_repl.image.ImageView{:image #object[java.awt.image.BufferedImage 0x3f92632b \"BufferedImage@3f92632b: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@5cb468ce transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 191 height = 251 #numDataElements 4 dataOff[0] = 3\"], :alt \"\", :type \"png\", :width 191, :height 251})"}
;; <=

;; **
;;; The names given to graphs using the commit form must be unique. Trying to tag another graph with the same name will result in an error:
;; **

;; @@
(-> (newgrape) hello (commit "mygraph"))
;; @@
;; ->
;;; Caught exception: org.neo4j.driver.exceptions.ClientException: Node(898) already exists with label `__Graph` and property `tag` = &#x27;mygraph&#x27;
;;; 
;; <-
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; **
;;; Committed graphs can be "uncommitted" using the `uncommit` form:
;; **

;; @@
(uncommit "mygraph")
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-string'>&quot;50774a87-39f8-4e65-8690-a07763d0eaff&quot;</span>","value":"\"50774a87-39f8-4e65-8690-a07763d0eaff\""}
;; <=

;; **
;;; ### 7.1.1 Rolling back uninteresting derivations
;;; We may want to roll back uninteresting graph derivations, for example to free up resources or to prune graph processes. We can do so by using the `rollback` form. **Warning**: calling rollback will remove _all_ graphs that are not in the history of any _committed_ (tagged) graph.
;;; 
;;; The following example illustrates this behaviour. In the code block below, we create a graph process with four different branches, originating from the same empty start graph. We commit a tag for the end-result of one of these derivations.
;; **

;; @@
(def start (newgrape))

(-> start hello world vine)
(-> start hello world vine)
(-> start hello world vine)
(-> start hello world vine)
(commit _ "my graph")
(viewproc start)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"563\" height=\"407\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x77538129 \"BufferedImage@77538129: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@5cb468ce transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 563 height = 407 #numDataElements 4 dataOff[0] = 3\"]"}
;; <=

;; **
;;; Calling `rollback` will remove all graphs that "do not lead up to" a committed (tagged) graph in the graph process. (see below)
;; **

;; @@
(rollback)
(viewproc start)
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"134\" height=\"407\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x1fce9ab \"BufferedImage@1fce9ab: type = 6 ColorModel: #pixelBits = 32 numComponents = 4 color space = java.awt.color.ICC_ColorSpace@5cb468ce transparency = 3 has alpha = true isAlphaPre = false ByteInterleavedRaster: width = 134 height = 407 #numDataElements 4 dataOff[0] = 3\"]"}
;; <=

;; **
;;; # 8. Control structures
;;; 
;;; Since @@GrapeVine@@ is embedded into Clojure, all the regular Clojure control structures are available to program with graph transformations. We have already seen that the Clojure _threading macro_ **(->)** is well-suited for **sequential composition** of graph productions, tests and queries.  
;;; 
;;; The other two common concerns are **parallel composition** of productions and conditional **looping** behaviour. While these behaviours can readily be programmed in Clojure, the host language does not provide convenient macros similar to the threading macro *(->)* we used for *sequential composition*.
;;; 
;;; For convenience @@GrapeVine@@ therefore defines a form for **parallel composition** of graph productions **(||)** and a form for conditional **looping** behaviour **(->*)**.
;;; 
;;; Consider the well-known [Wolf-Goat-Cabbage (well, Wolf-Goat-Grape problem)](https://en.wikipedia.org/wiki/Wolf,_goat_and_cabbage_problem) as an example.
;;; 
;;; ![](https://www.mathworks.com/matlabcentral/mlc-downloads/downloads/submissions/55054/versions/1/screenshot.gif)
;;; 
;;; Below is specification of the problem. Rule `setup-ferryman` creates the starting situation. The ferryman can either take one item to the other side  (rule `ferry_one_over`) or he can cross without cargo (rule `cross_empty`). 
;;; 
;;; Then we have defined three graph queries. Two queries for testing the dangerious situations (wolf can eat goat or goat can eat grape) and one test to check whether we have solved the ridle (all on the other side).
;; **

;; @@
(list 
 
(rule 'setup-ferryman
  :create
  (pattern
    (node 'tg :label "Thing" :asserts {:kind "'Goat'"})
    (node 'tc :label "Thing" :asserts {:kind "'Grape'"})
    (node 'tw :label "Thing" :asserts {:kind "'Wolf'"})
    (node 's1 :label "Side" :asserts {:name "'This side'"})
    (node 's2 :label "Side" :asserts {:name "'Other side'"})
    (node 'f  :label "Ferry")
    (edge :label "is_at" :src 'tg :tar 's1)
    (edge :label "is_at" :src 'tc :tar 's1)
    (edge :label "is_at" :src 'tw :tar 's1)
    (edge :label "is_at" :src 'f :tar 's1)
    ))

(rule 'ferry_one_over
  :read
  (pattern :iso
    (node 's1 :label "Side")
    (node 's2 :label "Side")
    (node 'f :label "Ferry")
    (node 't :label "Thing")
    (edge 'et :label "is_at" :src 't :tar 's1)
    (edge 'e :label "is_at" :src 'f :tar 's1))
  :delete ['e 'et]
  :create
  (pattern
    (edge :label "is_at" :src 'f :tar 's2)
    (edge :label "is_at" :src 't :tar 's2)))

(rule 'cross_empty
  :read
  (pattern :iso
    (node 's1 :label "Side")
    (node 's2 :label "Side")
    (node 'f :label "Ferry")
    (edge 'e :label "is_at" :src 'f :tar 's1))
  :delete ['e ]
  :create
  (pattern
    (edge :label "is_at" :src 'f :tar 's2)))

(query 'wolf-can-eat-goat? []
  (pattern :iso
           (node 't1 :label "Thing" :asserts {:kind "'Wolf'"})
           (node 't2 :label "Thing" :asserts {:kind "'Goat'"})
           (node 's :label "Side")
           (node 's2 :label "Side")
           (edge :label "is_at" :src 't1 :tar 's)
           (edge :label "is_at" :src 't2 :tar 's)
           (node 'f :label "Ferry")
           (edge :label "is_at" :src 'f :tar 's2)))

(query 'goat-can-eat-grape? []
  (pattern :iso
           (node 't1 :label "Thing" :asserts {:kind "'Grape'"})
           (node 't2 :label "Thing" :asserts {:kind "'Goat'"})
           (node 's :label "Side")
           (node 's2 :label "Side")
           (edge :label "is_at" :src 't1 :tar 's)
           (edge :label "is_at" :src 't2 :tar 's)
           (node 'f :label "Ferry")
           (edge :label "is_at" :src 'f :tar 's2)))

(query 'all_on_the_other_side? []
  (pattern
           (node 'tg :label "Thing" :asserts {:kind "'Goat'"})
           (node 'tc :label "Thing" :asserts {:kind "'Grape'"})
           (node 'tw :label "Thing" :asserts {:kind "'Wolf'"})
           (node 's2 :label "Side" :asserts {:name "'Other side'"})
           (edge :label "is_at" :src 'tg :tar 's2)
           (edge :label "is_at" :src 'tc :tar 's2)
           (edge :label "is_at" :src 'tw :tar 's2)))
)

